import { FaUserAlt } from "react-icons/fa";
import './menu/script'
import { FiUsers ,FiChevronRight} from "react-icons/fi";
function Menu() {
    function ativar() {
        var menu = document.hasFocus();
        console.log(menu.innerHTML)

    }
    return (
        <div className="menu">
            <table className="table"  >
                <div className="title-menu activate" ><FiUsers className="icon-menu"></FiUsers>  Membro <FiChevronRight className="icon-Right"></FiChevronRight> </div>
                <li className="column">
                    Convidar
                </li>
                <li className="column activate">
                    <a className="link-menu">Geral</a>
                </li>
                <li className="column">
                    Pagamento
                </li>
                <li className="column">
                    Ativos
                </li>
            </table>
            <button onClick={ativar()}>ativar</button>


        </div>

    )
}

export default Menu
